SELECT *
FROM  #tFile34002 ff
WHERE NOT EXISTS(SELECT * FROM dbo.t_File f INNER JOIN dbo.t_RegistersAccounts a ON f.id=a.rf_idFiles WHERE ff.FileName2=FileNameHR AND a.AmountPayment=ff.AmountPay)
--- 
SELECT SUM(AmountPayment),COUNT(DISTINCT f.FileNameHR)
FROM dbo.t_File f INNER JOIN dbo.t_RegistersAccounts a ON
			 f.id=a.rf_idFiles
					INNER JOIN dbo.t_FileExit fe ON
			f.id=fe.rf_idFile                  
WHERE f.DateRegistration>'20180330' AND f.DateRegistration<'20180502' AND a.rf_idSMO='34002' AND DateUnLoad>'20180402' AND DateUnLoad<'20180501'


SELECT f.FileNameHR,f.DateRegistration, fe.DateUnLoad
FROM  #tFile34002 ff INNER JOIN dbo.t_File f ON
			ff.FileName2=f.FileNameHR
					INNER JOIN dbo.t_FileExit fe ON
			f.id=fe.rf_idFile                  
					INNER JOIN dbo.t_RegistersAccounts a ON
			f.id=a.rf_idFiles                  
ORDER BY fe.DateUnLoad,f.DateRegistration

